import MobileNavBar from "../MobileNavBar/MobileNavBar";
import './Pages.css';
import { useEffect } from "react";
import sparkle from '../../../images/sparkle-success.svg';

export default function AboutPage({ onBurgerClick, onBurgerClose, isBurgerOpen, orders, cart }) {
  useEffect(() => {
    document.title = 'О нас - Долина самоцветов';
  }, []);
  
  return (
    <>
      <main className="about">
      <div>
        <h1 className='success-header'>Заказ № оформлен успешно! Спасибо за покупку <img style={{marginLeft: '8px'}} src={sparkle}></img></h1>
        <p className='success-maintext'>В ближайшее время мы упакуем ваш заказ, передадим в доставку,</p>
        <p className='success-maintext'> а в вашем личном кабинете появится трек-номер для отслеживания!</p>
        </div>
      </main>
      <MobileNavBar
      onBurger={onBurgerClick} 
      isBurgerOpen={isBurgerOpen} 
      onBurgerClose={onBurgerClose}
      cart={cart}
      orders={orders}
      />
    </>
  )
}
